import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './components/home/home.component';
import { FlashCardList} from './components/FlashCardList/FlashCardList'; // Adjust the path as needed
import { FlashCardFormComponent } from './components/FlashCardForm/FlashCardForm'; // Adjust the path as needed

const routes: Routes = [
  { path: '', component: HomeComponent },
  { path: 'user-stories', component: FlashCardList },
  { path: 'add-story', component: FlashCardFormComponent },
  { path: 'edit-story/:title', component: FlashCardFormComponent }, // Edit route
  { path: 'delete-story/:title', component: FlashCardFormComponent  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
